import { ReactComponent as ClockIcon } from './icons/clock.svg';
import { ReactComponent as CalenderIcon } from './icons/calendar.svg';

function reloj() {
    return (
        <div className="nav">
            <CalenderIcon />
            <p>date</p>
            <ClockIcon />
            <p>time</p>
        </div>
    );
}

export default reloj;
